import React from "react";
import Logo from '../Assets/images/logo.png';
import Searchicon from '../Assets/images/icon/search-normal.svg';
import Header1icon from '../Assets/images/icon/maximize.svg';
export default function Header() {
    return (
        <>

        <div className="Header-container d-flex align-items-center justify-content-between">
           <div className="d-flex  align-items-center">
           <div className="Logo-container p-4">
                <img src={Logo}/>
            </div>
            <div className="Searchbar col-9 d-flex position-relative ">
                <img src={Searchicon}/>
                <input className="form-control broder-0 w-100 ps-5" placeholder="Search.."/>
            </div>
           </div>
           <div>

           <span className="right-icon peeeeeeeeeeee-5">
              <img src={Header1icon}/>
           </span>
           </div>
        </div>



        </>
    );
}
